export default {
  getAddress(state) {
    return state.address;
  },
  getAddresses(state) {
    return state.addresses;
  },
  getAddressData(state) {
    return state.addressData;
  },
  getNewData(state) {
    console.log(state.newData, 'getters');

    return state.newData;
  }
};
